import React from 'react';
import {connect} from "react-redux";

import BoxList from "./BoxList";
import Background from "../_layouts/default/Background";
import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Footer from "../_layouts/_includes/footer/Footer";

const HomeContainer = React.memo((props) => {
    const {images} = props

    return (
        <Background>
            <Header user/>

            <Content toolbared={true}>
                <BoxList images={images}/>
            </Content>

            <Footer />
        </Background>
    );
})

const mapStateToProps = (store) => {
    return {
        images: store.homePage.images,
    }
}


export default connect(mapStateToProps)(HomeContainer)
